DROP TABLE IF EXISTS `lost_cus`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lost_cus` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'id主键',
  `lost_id` int NOT NULL COMMENT '流失客户id',
  `lost_time` int NOT NULL DEFAULT '0' COMMENT '客户流失时间(按月计)',
  `cus_phone` char(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '客户电话',
  `cus_email` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '客户邮箱',
  `contact_time` int DEFAULT '0' COMMENT '联系次数',
  `confirm_loss` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '0' COMMENT '确认流失',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `FK_lost_cus_customer` (`lost_id`),
  CONSTRAINT `FK_lost_cus_customer` FOREIGN KEY (`lost_id`) REFERENCES `customer` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='流失客户表';
