--
-- Table structure for table `order_details`
--

DROP TABLE IF EXISTS `order_details`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `order_details` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '详情id',
  `order_id` int NOT NULL COMMENT '订单id',
  `service_type` char(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '00' COMMENT '服务类型',
  `order_date` datetime NOT NULL COMMENT '订单日期',
  `price` float(10,2) DEFAULT NULL COMMENT '单价',
  `number` int DEFAULT NULL COMMENT '数量',
  `total` float(10,2) DEFAULT NULL COMMENT '总价',
  `res_flow` float(10,2) DEFAULT '0.00' COMMENT '剩余流量(单位:M)',
  `res_time` int DEFAULT '0' COMMENT '剩余时间(单位:天)',
  `is_valid` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '0' COMMENT '是否有效',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `FK_order_details_customer_order` (`order_id`),
  CONSTRAINT `FK_order_details_customer_order` FOREIGN KEY (`order_id`) REFERENCES `customer_order` (`id`),
  CONSTRAINT `order_details_chk_1` CHECK ((`number` > 0)),
  CONSTRAINT `order_details_chk_2` CHECK (((`number` * `price`) = `total`)),
  CONSTRAINT `order_details_chk_3` CHECK ((`res_flow` >= 0)),
  CONSTRAINT `order_details_chk_4` CHECK ((`res_time` >= 0))
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='订单详情表';
/*!40101 SET character_set_client = @saved_cs_client */;

